import React from 'react';
import "../css/circle.css";
import ScrollHorizontal from 'react-scroll-horizontal'
//import {StyleSheet, Text, View, Image, TouchableOpacity,ScrollView} from 'react-native';
function Project() {
    return (  
        <>     
        <h1 style={{
            height: "34px",
            width: "100px",
            left: "35px",
            top: "90px",
            fontFamily: "Noto Sans",
            fontSize: "25px",
            position: "absolute",
            fontStyle: "normal",
            fontWeight:"600"
        }}>프로젝트</h1>
        <div id='scroll-horizontal' style={{height:'55px' }}>
            <ScrollHorizontal>
                
                {/* {renderCards} */}
            </ScrollHorizontal>
        </div>
        </>
    );
}

export default Project
